description:
Category	Feature, Parody / Spoof

Director	Jordan Septo
Starring	Capri Anderson, Annika Albrite, Evan Stone, Logan Pierce, Xander Corvus, Tommy Pistol, Lily Carter, Ryan Driller

Starring Anikka Albrite &amp; Tommy Pistol!

An alcoholic that lost everything decides to go to Las Vegas to spend his last days. In unexpected circumstances, he literally runs into a prostitute that is just sad and lonely as himself. The two begin a strange relationship based on codependency. Can a drunk and a whore find true love in the city of sin? Stranger things have happened in Vegas!


